output_description:
Design a computational model for the given task. The model should obtain the utility, (not the probability of choosing an action).  Your goal is to eventually explore the entire space of possible explainations and mechanisms by which the observed behavior arises.

Your model should use the given variables appropriately, but does not necessary need to use all or even most of the variables. Do not include the model for the utility of rejecting an offer. 

The model should:
1. Predict only responder behavior.
2. Build on relevant psychological principles.
3. Be considerate of high covariance between learnable parameters as the model will have to pass parameter recovery tests.
4. Be applicable to the dataset given within the task description (i.e. the model should be able to be run using only the provided dataset structure).
5. Not include parameters to simulate general stochasticity of behavior, because this will be handled later by a temperature parameter.
6. Should have no more than two learnable parameters.
7. This specific model should calculate the utility of an action, which will then be used to determine the probability of choosing that action. Negative values should represent a negative utility, and thus an unlikely action.

For any learnable parameters in your model, you must specify finite numerical bounds (it just can not be infinity) in the variable descriptions. However, this bound should be generous. The utility variable may be unbounded (-inf to inf).

First, reason step by step about:
* The key psychological mechanisms involved
* How these mechanisms interact
* What mathematical form could capture these interactions
* What parameters would be needed to calibrate the model
* How the model variables map to observable behavior

Then, provide your formal mathematical model between <MODEL> tags, followed by variable descriptions between <VARIABLES> tags. Use clear mathematical notation and ensure each variable is fully described. Every variable must be utilized within the mathematical formula provided between <MODEL> and </MODEL>. For variable descriptions, provide them in a JSON format with the following structure: <VARIABLES> Bounds are by default inclusive. Please spell out the greek variable names instead of using the symbols. Finally, you should provide a short description of the model in the summary tags <SUMMARY> </SUMMARY>. This will be used to compare different computational models of the task; it should be concise and purely descriptive. Do not include generic information about the name of the tasks, since that is implied. 

{
  "variables": {
    "variable_name": {
      "description": "Clear description",
      "range": {
        "min": value,
        "max": value,
        "inclusive_min": boolean,
        "inclusive_max": boolean
      },
      "distribution": {
        "type": "distribution type",
        "parameters": {}
      },
      "learnable": boolean,
      "source": "learnable/data/calculated"
    }
  }
}
</VARIABLES>

Example #1: 
<EXAMPLE>
(Model of a Random Choice Task):
Let me think through this step by step...
[your reasoning here]

<MODEL>
U_i = β + εE + ηN
</MODEL>

<VARIABLES>
{
  "variables": {
    "U_i": {
      "description": "Utility of choosing action i",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "beta": {
      "description": "Base tendency parameter (inherent preference)",
      "range": {
        "min": 0,
        "max": 1
      },
      "learnable": true,
      "source": "learnable"
    },
    "epsilon": {
      "description": "Environmental sensitivity parameter",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": true,
      "source": "learnable"
    },
    "E": {
      "description": "Environmental cue value",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    },
    "eta": {
      "description": "Noise parameter",
      "range": {
        "min": 0,
        "max": 1,
        "exclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "N": {
      "description": "Random noise drawn from normal distribution N(0,1)",
      "distribution": {
        "type": "normal",
        "mean": 0,
        "std": 1
      },
      "learnable": false,
      "source": "calculated"
    }
  }
}
</VARIABLES>
<SUMMARY>
A linear utility model combining base preference, environmental influence, and stochastic noise. The model uses two learnable parameters: a base tendency parameter (β) constrained to [0,1] and an unconstrained environmental sensitivity parameter (ε). Environmental cues and normally distributed noise modify the base utility, allowing for both systematic and random variation in choice behavior.
</SUMMARY>
</EXAMPLE>

Please be sure to provide the mathematical formula for the model between <MODEL> and </MODEL>, and the variable descriptions between <VARIABLES> and </VARIABLES>. No description of the model should be provided within the <MODEL> tags.

The parameter names you choose in your <VARIABLES> section will be used exactly as specified in subsequent code generation. Please choose clear, non-reserved parameter names that can be used directly in Python code. For example, avoid Python reserved words like 'lambda' and use alternatives like 'learning_rate' or 'lambda_param'. DO NOT USE 'lambda' AS A PARAMETER NAME.

complete_model_interaction.output:
Step-by-step reasoning:
1. Key psychological mechanisms: In ultimatum-type games, responders compare the offered monetary share (split_self) to an expected fair share. The fair share is naturally inferred from the relative contributions (token_self and token_opp) to the total pot (combined_earning). A deviation in the offer below the fair share evokes a negative utility (a fairness “punishment”). In contrast, offers that meet or exceed the fair share do not incur a fairness penalty.
2. Interaction of mechanisms: The model assumes that responders experience utility from the monetary amount received (split_self) plus a possible baseline tendency to accept (beta). When the offer is lower than what is “fair” (i.e. below ideal_share computed as (token_self/(token_self+token_opp))*combined_earning), a fairness penalty is subtracted, scaled by sensitivity parameter alpha. Offers equal to or above the fair share do not receive the penalty.
3. Mathematical form: Define ideal_share = (token_self/(token_self+token_opp))*combined_earning. Then, using a piecewise structure:
  If split_self < ideal_share, subtract the difference weighted by alpha.
  If split_self ≥ ideal_share, no penalty is applied.
   Adding a baseline acceptance bias term (beta) gives:
  U_accept = split_self + beta – alpha * max(ideal_share – split_self, 0)
4. Parameters needed: Two learnable parameters,
  alpha: fairness sensitivity (penalty weight on being underpaid),
  beta: acceptance bias (a baseline additive term).
5. Mapping to observable behavior: The model utilizes token_self, token_opp, and combined_earning to compute the fair share for the participant. The actual offer (split_self) is then compared to that fair share – a discrepancy below fairness reduces the utility significantly (via alpha). Beta captures any overall predisposition to accept offers regardless of fairness, while the utility value U_accept (which is in monetary units) is then used to predict the probability of accepting an offer (after incorporating a temperature parameter externally).

Below is the formal model specification and corresponding variable descriptions.

<MODEL>
U_accept = split_self + beta - alpha * max((token_self / (token_self + token_opp)) * combined_earning - split_self, 0)
</MODEL>

<VARIABLES>
{
  "variables": {
    "U_accept": {
      "description": "Calculated utility of accepting an offer, in monetary units (£). A negative value indicates a low likelihood of acceptance.",
      "range": {
        "min": "-inf",
        "max": "inf",
        "inclusive_min": false,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "calculated"
    },
    "beta": {
      "description": "Baseline acceptance bias representing an overall tendency to accept offers, irrespective of fairness considerations.",
      "range": {
        "min": -100,
        "max": 100,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "distribution": {
        "type": "uniform",
        "parameters": {
          "min": -100,
          "max": 100
        }
      },
      "learnable": true,
      "source": "learnable"
    },
    "alpha": {
      "description": "Fairness sensitivity parameter that penalizes offers below the expected fair share derived from token contributions.",
      "range": {
        "min": 0,
        "max": 100,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "distribution": {
        "type": "uniform",
        "parameters": {
          "min": 0,
          "max": 100
        }
      },
      "learnable": true,
      "source": "learnable"
    },
    "split_self": {
      "description": "Monetary share proposed for the participant (in £).",
      "range": {
        "min": "-inf",
        "max": "inf",
        "inclusive_min": false,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "token_self": {
      "description": "Number of tokens found by the participant; used to compute the expected share.",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "token_opp": {
      "description": "Number of tokens found by the opponent; used to compute the expected share.",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    },
    "combined_earning": {
      "description": "Total monetary earning in the trial, in £, calculated as tokens multiplied by £3.",
      "range": {
        "min": 0,
        "max": "inf",
        "inclusive_min": true,
        "inclusive_max": false
      },
      "learnable": false,
      "source": "data"
    }
  }
}
</VARIABLES>

<SUMMARY>
The model computes the utility of accepting a monetary offer by combining the received monetary amount (split_self) with a baseline bias (beta) and subtracting a fairness penalty weighted by sensitivity parameter (alpha) when the offer falls below an expected fair share. The expected fair share is derived from the ratio of the participant’s tokens to the total tokens, multiplied by the combined earnings.
</SUMMARY>

